// import logo from './logo.svg';
import './App.css';
import rouletteImage from './roulette_img.png';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={rouletteImage} className="App-logo" alt="logo" />
        <p>
          Touch to continue
        </p>
      </header>
    </div>
  );
}

export default App;
